■商品特徴<br>●透明度が高いので目立ちにくい。<br>●やわらか素材で、自然なつけ心地。<br>●キズ口をやさしく保護します。<br>NEW Point!<br>●ベース素材のウレタンフィルムが薄くなりました。それによって貼った際の違和感が少なくなりました。<br>●ハイドロコロイド粒子が、キズ口から出てくる体液を吸水して膨らみクッションに   なります。吸水率が従来品に比べて約22％アップしました。<br>●指に巻いた場合以前の商品より重なる部分が小さくなったので、シワにならず　 剥がれにくくなっています。<br><br>◆ハイドロ救急バンのしくみ<br>貼り付け後、しばらくするとハイドロコロイド素材のパッドが傷口から出る<font color="red">体液を吸収して白くふくらみます。</font><br>ハイドロ救急バンは、水やばい菌を防ぎ、キズの治療に適した環境を整え、<font color="red">傷をやさしく保護します。</font><br><img src="http://image.rakuten.co.jp/drugpure/cabinet/kihon12/4955574823615sikumi.jpg" alt="モイストヒーリング"><br><br>■仕様<br>◆基材：ポリウレタン<br>◆パッド：ハイドロコロイド<br>◆粘着剤：アクリル系(低アレルギー性粘着剤)<br><br>■販売名：ハイドロエンドバンドLEa<br><br>■注意<br>以下の場合ご使用にならないで下さい。<br>(1)感染が見られる傷、感染を起こす可能性のある傷<br>(2)にきび、湿疹、虫刺され、皮膚炎などの症状<br>(3)目の周囲、粘膜<br>(4)かさぶたができている傷<br>(5)殺菌・消毒・軟膏・クリーム等の併用<br><br><br>広告文責：株式会社ドラッグピュア<br>作成：201112SN<br>神戸市北区鈴蘭台北町1丁目1-11-103<br>TEL:0120-093-849<br>製造販売者：日進医療器株式会社<br>区分：一般医療機器・日本製<br>医療機器届出番号：27B2X00110S00014<br><br><br><br><font color="#cc0000">■ <b>関連商品</b></font><br><style type="text/css"><!--* { box-sizing : border-box}* { -moz-box-sizing : border-box}.ol{list-style-type:decimal; margin: 0 0 0 30px;padding:0}.u1 { list-style-image: url(http://image.rakuten.co.jp/drugpure/cabinet/signboard/list-red.gif);margin: 0 0 0 20px; padding: 0;}--> </style><ul class="u1"><li>日進医療器株式会社お取り扱い商品</li><li>リーダーシリーズ</li><li>エルモシリーズ</li><li>ハイドロ救急シリーズ</li><li>おきゅう博士シリーズ</li><li>きくばりシリーズ</li><li>“金メッキ鍼”きくばりゴールドシリーズ</li><li>“圧粒子が苦手な方へ”エンピシンシリーズ</li><li>“チタンテープと磁気”ユニコ磁気バンシリーズ</li><li>“きくばりと同じ鍼と圧粒子効果”祐徳薬品・スポールバン</li><li>“圧粒子が苦手な人に。完全国内製造”平和メディク・ラークバン</li></ul><style type="text/css"><!--
